export const partnersContainerStyles = {
  display: 'flex',
  width: '100%',
  // maxWidth: '1280px',
  margin: '5% auto 0 auto',
  flexDirection: 'column',
  justifyContent: 'center',
  alignItems: 'center',
  // outline: '1px solid blue',
  padding: '2% 0',
  boxSizing: 'border-box',
  backgroundColor: 'primary.light',
  color: 'primary.main',
};

export const partnersHeaderStyles = {
  mb: '2%',
  color: 'secondary.dark',
  // fontWeight: 600,
  // letterSpacing: '0.5rem',
};

export const partnersInnerContainerStyles = {
  display: 'flex',
  width: '80%',
};

export const partnersBoxStyles = {
  display: 'flex',
  flexDirection: 'column',
  width: '15%',
  justifyContent: 'flex-end',
  alignItems: 'center',
  // outline: '1px solid blue',
  margin: '0 15px',
  textAlign: 'center',
};

export const partnersLogoStyles = {
  width: '50%',
  height: '50%',
  objectFit: 'contain',
  margin: '0 0 10px 0',
};
